instance.peoplecode_text:
/**
* Gets/Sets Student Enrollment data into/from a legit Peoplesoft Tables
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_StudentEnrollment
   method CCTC_StudentEnrollment();

   method getEnrollments(&bindVars As array of any) Returns array of array of any;

   method requestEnrollment(&bindVars As array of any) Returns array of array of any;

   method dropEnrollment(&bindVars As array of any) Returns array of array of any;

   method checkEnrollmentRequest(&bindVars As array of any) Returns array of array of any;

   method getEnrollmentErrorMessage(&bindVars As array of any) Returns array of array of any;

   method getStudentPrerequisiteStatus(&bindVars As array of any) Returns array of array of any;

end-class;

method CCTC_StudentEnrollment
   rem do nothing;
end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve all the actual (as opposed to requested) enrollments of the Student
* 
* @param &bindVars array of keys to retrieve from the legit enrollment table
* &bindVars[1]: sis Person Id (aka EMPLID)
* &bindVars[2]: sis Term Cd (aka strm)
* &bindVars[3]: sis Section Id (aka class nbr)
* &bindVars[4]: institution code
* &bindVars[5]: academic career code
* @Returns 2d array with enrollment request rows found, if any
*/
method getEnrollments
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 5 Then
      Error "bindVars should have 5 elements when requesting enrollment";
   End-If;

   If None(&bindVars [1]) Then
      &bindVars [1] = "%";
   End-If;

   If None(&bindVars [2]) Then
      &bindVars [2] = "%";
   End-If;

   If None(&bindVars [3]) Then
      &bindVars [3] = "%";
   End-If;

   If None(&bindVars [4]) Then
      Error "institution is required";
   End-If;

   If None(&bindVars [5]) Then
      Error "acad_career is required";
   End-If;

   If &bindVars [1] = "%" And
         &bindVars [2] = "%" And
         &bindVars [3] = "%" Then
      Error "when emplid not provided, strm and class_nbr are required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_STDNT_ENRL_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK Then
      Error String(&sql.Status);
   Else
      Local number &i = 0;
      rem this loop does an inner query. with MaxRows = 999, worst case scenario is 1000 total queries;
      Local number &maxRows = 999;
      While &sql.Fetch(&AAny) And
            &i < &maxRows
         Local number &j = 0;
         Local array of any &temp = CreateArrayAny();
         For &j = 1 To &AAny.Len
            &temp.Push(&AAny [&j]);
         End-For;

         rem for each enrollment record, also get the cid for the course;
         Local array of any &cid_input = CreateArrayAny();
         rem set crse_id for subquery;
         &cid_input [1] = &AAny [11];
         Local array of any &cid_AAny = CreateArrayAny();
         Local SQL &cid_sql = GetSQL(SQL.CCTC_CRSEID_CID_GET, &cid_input);
         If &cid_sql.Status = %SQLStatus_OK Then
            Local number &cid_i = 0;
            Local number &max_cid_Rows = 1;
            While &cid_sql.Fetch(&cid_AAny) And
                  &cid_i < &max_cid_Rows
               &temp.Push(&cid_AAny [1]);
               &cid_i = &cid_i + 1;
            End-While;
            If &cid_i = 0 Then
               &temp.Push("");
            End-If;
         Else
            &temp.Push("");
         End-If;
         &cid_sql.Close();

         &result_list.Push(&temp);
         &i = &i + 1;
      End-While;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* request a Student be enrolled into a section
* Process based on workflow/pipeline described here:
* https://docs.oracle.com/cd/E56917_01/cs9pbr4/eng/cs/lssr/concept_UnderstandingClassEnrollmentProcessing-ab456f.html#topofpage
*
* @param &bindVars array of keys to insert data
* &bindVars[1]: sisPersonId (aka emplid)
* &bindVars[2]: sisTermId (aka strm)
* &bindVars[3]: sisSectionId (aka class nbr)
* &bindVars[4]: institution
* &bindVars[5]: academic career
* &bindVars[6]: action reason (optional)
* @Returns 2d array: first row: [ first column: [requestId] second column: [Enrollment request status code] ]
*/
method requestEnrollment
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 6 Then
      Error "bindVars should have 6 elements when requesting enrollment";
   End-If;

   Local string &emplid = &bindVars [1];
   If None(&emplid) Then
      Error "emplid is required";
   End-If;

   Local string &strm = &bindVars [2];
   If None(&strm) Then
      Error "strm is required";
   End-If;

   Local string &class_nbr = &bindVars [3];
   If None(&class_nbr) Then
      Error "class_nbr is required";
   End-If;

   Local string &institution = &bindVars [4];
   If None(&institution) Then
      Error "institution is required";
   End-If;

   Local string &acad_career = &bindVars [5];
   If None(&acad_career) Then
      Error "acad_career is required";
   End-If;

   Local string &actionRsn = &bindVars [6];
   rem action reason is optional;

   rem first check that student not already fully enrolled in this class this term;
   Local array of any &enrlExistCheck = CreateArrayAny();
   Local SQL &sql = GetSQL(SQL.CCTC_STDNT_ENRL_GET, &bindVars);
   If &sql.Status = %SQLStatus_OK Then
      Local number &eec_i = 0;
      Local number &eec_maxRows = 50;
      While &sql.Fetch(&enrlExistCheck) And
            &eec_i < &eec_maxRows
         Local string &enrlStat = &enrlExistCheck [4];
         If &enrlStat = "E" Then
            Error "enrollment record already exists";
         End-If;
         &eec_i = &eec_i + 1;
      End-While;
   End-If;
   &sql.Close();


   Local ApiObject &oEnrlRequest = (%Session).GetCompIntfc(CompIntfc.ENRL_REQUEST);
   If &oEnrlRequest = Null Then
      Error "Could not instantiate the ENRL_REQUEST Component Interface";
   End-If;

   &oEnrlRequest.InteractiveMode = False;
   &oEnrlRequest.GetHistoryItems = True;
   &oEnrlRequest.EditHistoryItems = False;

   rem check if enrollment request already exists by looping through this student's enrollment requests this term;
   &oEnrlRequest.ENRL_REQUEST_ID = "";
   &oEnrlRequest.EMPLID = &emplid;
   &oEnrlRequest.ACAD_CAREER = &acad_career;
   &oEnrlRequest.INSTITUTION = &institution;
   &oEnrlRequest.STRM = &strm;
   Local ApiObject &findResults = &oEnrlRequest.Find();

   Local number &I;
   For &I = 1 To &findResults.Count
      Local ApiObject &currentEnrlRequest = &findResults.Item(&I);
      If Not &currentEnrlRequest.Get() Then
         Error "Could not get the enrollment request record when verifying if requests exists";
      End-If;
      Local ApiObject &currentEnrlReqDetailCollection = &currentEnrlRequest.ENRL_REQ_DETAIL;
      Local number &J;
      For &J = 1 To &currentEnrlReqDetailCollection.Count
         Local ApiObject &currentEnrlReqDetail = &currentEnrlReqDetailCollection.Item(&J);
         If &currentEnrlReqDetail.CLASS_NBR = &class_nbr And
               &currentEnrlReqDetail.ENRL_REQ_DETL_STAT = "P" Then
            rem if any add/drop/gradechanges requests are pending for this class, dont add more noise/requests;
            Error "pending request currently exists";
         End-If;
      End-For;
   End-For;

   rem if not found, go ahead and create it (in memory);
   &oEnrlRequest.ENRL_REQ_ACTION = "E";
   &oEnrlRequest.CLASS_NBR = &class_nbr;

   If Not &oEnrlRequest.Create() Then
      Error "Creating the add enrollment request record failed";
   End-If;

   rem Note: once created (in memory), it is not automatically saved;
   rem We must save the 'created' record using save method to persist in db;
   Local ApiObject &oEnrlReqDetailCollection = &oEnrlRequest.ENRL_REQ_DETAIL;
   Local ApiObject &oEnrlReqDetail = &oEnrlReqDetailCollection.Item(1);

   &oEnrlReqDetail.CLASS_NBR = &class_nbr;
   &oEnrlReqDetail.ENRL_REQ_ACTION = "E";

   If All(&actionRsn) Then
      &oEnrlReqDetail.ENRL_ACTION_REASON = &actionRsn;
   End-If;

   If Not &oEnrlRequest.Save() Then
      Error "Saving the add enrollment request record failed";
   End-If;

   DoSaveNow();
   CommitWork();

   rem finally, run the enrollment request process;
   rem note, cobol program is ran within the FieldChange peoplecode of ENRL_RE_HDR_WRK.ENRL_REQ_RC_PB;
   &oEnrlRequest.ENRL_REQ_RC_PB = "X";

   rem by changing the value, the enrollment request engine should have ran;
   rem return the request_id, and its approve/deny status;
   Local array of any &result_row = CreateArrayAny();
   &result_row [1] = &oEnrlRequest.ENRL_REQUEST_ID_0;
   &result_row [2] = &oEnrlReqDetail.ENRL_REQ_DETL_STAT;
   Return CreateArray(&result_row);

end-method;

/**
* This function provides an interface to the College Adaptor to 
* Drop a student's enrollment in a class
* Process based on workflow/pipeline described here:
* https://docs.oracle.com/cd/E56917_01/cs9pbr4/eng/cs/lssr/concept_UnderstandingClassEnrollmentProcessing-ab456f.html#topofpage
*
* @param &bindVars array of data keys to drop enrollment of
* &bindVars[1]: sisPersonId (aka emplid)
* &bindVars[2]: sisTermId (aka strm)
* &bindVars[3]: sisSectionId (aka class nbr)
* &bindVars[4]: institution
* &bindVars[5]: academic career
* &bindVars[6]: action reason (optional)
* @Returns 2d array: first row: [ first column: [requestId] second column: [Enrollment request status code] ]
*/
method dropEnrollment
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 6 Then
      Error "bindVars should have 6 elements when requesting enrollment";
   End-If;

   Local string &emplid = &bindVars [1];
   If None(&emplid) Then
      Error "emplid is required";
   End-If;

   Local string &strm = &bindVars [2];
   If None(&strm) Then
      Error "strm is required";
   End-If;

   Local string &class_nbr = &bindVars [3];
   If None(&class_nbr) Then
      Error "class_nbr is required";
   End-If;

   Local string &institution = &bindVars [4];
   If None(&institution) Then
      Error "institution is required";
   End-If;

   Local string &acad_career = &bindVars [5];
   If None(&acad_career) Then
      Error "acad_career is required";
   End-If;

   Local string &actionRsn = &bindVars [6];
   rem action reason is optional;

   rem first check that student is fully enrolled in this class this term;
   Local number &enrollmentFound = 0;
   Local array of any &enrlExistCheck = CreateArrayAny();
   Local SQL &sql = GetSQL(SQL.CCTC_STDNT_ENRL_GET, &bindVars);
   If &sql.Status = %SQLStatus_OK Then
      Local number &eec_i = 0;
      Local number &eec_maxRows = 50;
      While &sql.Fetch(&enrlExistCheck) And
            &eec_i < &eec_maxRows
         Local string &enrlStat = &enrlExistCheck [4];
         If &enrlStat = "E" Then
            &enrollmentFound = 1;
            rem break out of loop early now that we found a record;
            &eec_i = &eec_maxRows;
         End-If;
         &eec_i = &eec_i + 1;
      End-While;
   End-If;
   &sql.Close();

   If &enrollmentFound = 0 Then
      Error "no enrollment found to drop";
   End-If;

   Local ApiObject &oEnrlRequest = (%Session).GetCompIntfc(CompIntfc.ENRL_REQUEST);
   If &oEnrlRequest = Null Then
      Error "Could not instantiate the ENRL_REQUEST Component Interface";
   End-If;

   &oEnrlRequest.InteractiveMode = False;
   &oEnrlRequest.GetHistoryItems = True;
   &oEnrlRequest.EditHistoryItems = False;

   rem check if a pending add/drop enrollment request exists by looping through this student's enrollment request this term;
   &oEnrlRequest.ENRL_REQUEST_ID = "";
   &oEnrlRequest.EMPLID = &emplid;
   &oEnrlRequest.ACAD_CAREER = &acad_career;
   &oEnrlRequest.INSTITUTION = &institution;
   &oEnrlRequest.STRM = &strm;
   Local ApiObject &findResults = &oEnrlRequest.Find();

   Local number &I;
   For &I = 1 To &findResults.Count;
      Local ApiObject &currentEnrlRequest = &findResults.Item(&I);
      If Not &currentEnrlRequest.Get() Then
         Error "Could not get the enrollment request record when looping through find results";
      End-If;
      Local ApiObject &currentEnrlReqDetailCollection = &currentEnrlRequest.ENRL_REQ_DETAIL;
      Local number &J;
      For &J = 1 To &currentEnrlReqDetailCollection.Count;
         rem loop through all classes within this enrollment request;
         Local ApiObject &currentEnrlReqDetail = &currentEnrlReqDetailCollection.Item(&J);
         If &currentEnrlReqDetail.CLASS_NBR = &class_nbr And
               &currentEnrlReqDetail.ENRL_REQ_DETL_STAT = "P" Then
            rem if any add/drop/gradechanges requests are pending for this class, dont add more noise/requests;
            Error "pending request currently exists";
         End-If;
      End-For;
   End-For;

   rem if not found, go ahead and create it (in memory);
   &oEnrlRequest.ENRL_REQ_ACTION = "D";
   &oEnrlRequest.CLASS_NBR = &class_nbr;

   If Not &oEnrlRequest.Create() Then
      Error "Creating the drop enrollment request record failed";
   End-If;

   rem Note: once created (in memory), it is not automatically saved;
   rem We must save the 'created' record using save method to persist in db;
   Local ApiObject &oEnrlReqDetailCollection = &oEnrlRequest.ENRL_REQ_DETAIL;
   Local ApiObject &oEnrlReqDetail = &oEnrlReqDetailCollection.Item(1);

   &oEnrlReqDetail.CLASS_NBR = &class_nbr;
   &oEnrlReqDetail.ENRL_REQ_ACTION = "D";

   If All(&actionRsn) Then
      &oEnrlReqDetail.ENRL_ACTION_REASON = &actionRsn;
   End-If;

   If Not &oEnrlRequest.Save() Then
      Error "Saving the drop enrollment request record failed";
   End-If;

   DoSaveNow();
   CommitWork();

   rem finally, run the enrollment request process;
   rem note, cobol program is ran within the FieldChange peoplecode of ENRL_RE_HDR_WRK.ENRL_REQ_RC_PB;
   &oEnrlRequest.ENRL_REQ_RC_PB = "X";

   rem by changing the value, the enrollment request engine should have ran;
   rem return the request_id, and its approve/deny status;
   Local array of any &result_row = CreateArrayAny();
   &result_row [1] = &oEnrlRequest.ENRL_REQUEST_ID_0;
   &result_row [2] = &oEnrlReqDetail.ENRL_REQ_DETL_STAT;
   Return CreateArray(&result_row);

end-method;

/**
* This function provides an interface to the College Adaptor to 
* check the status of a enrollment request
*
* @param &bindVars array of keys to insert data
* &bindVars[1]: sisPersonId (aka emplid)
* &bindVars[2]: sisTermId (aka strm)
* &bindVars[3]: sisSectionId (aka class nbr)
* &bindVars[4]: institution
* &bindVars[5]: academic career
* &bindVars[6]: request id
* @Returns 2d array: first row: [ first column: [Enrollment request status code] ]
*/
method checkEnrollmentRequest
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 6 Then
      Error "bindVars should have 6 elements when checking an enrollment request";
   End-If;

   Local string &emplid = &bindVars [1];
   If None(&emplid) Then
      Error "emplid is required";
   End-If;

   Local string &strm = &bindVars [2];
   If None(&strm) Then
      Error "strm is required";
   End-If;

   Local string &class_nbr = &bindVars [3];
   If None(&class_nbr) Then
      Error "class_nbr is required";
   End-If;

   Local string &institution = &bindVars [4];
   If None(&institution) Then
      Error "institution is required";
   End-If;

   Local string &acad_career = &bindVars [5];
   If None(&acad_career) Then
      Error "acad_career is required";
   End-If;

   Local string &requestId = &bindVars [6];
   If None(&acad_career) Then
      Error "requestId is required";
   End-If;

   Local ApiObject &oEnrlRequest = (%Session).GetCompIntfc(CompIntfc.ENRL_REQUEST);
   If &oEnrlRequest = Null Then
      Error "Could not instantiate the ENRL_REQUEST Component Interface";
   End-If;

   &oEnrlRequest.InteractiveMode = False;
   &oEnrlRequest.GetHistoryItems = True;
   &oEnrlRequest.EditHistoryItems = False;

   rem check if enrollment request already exists by looping through this student's enrollment requests this term;
   &oEnrlRequest.ENRL_REQUEST_ID = &requestId;
   &oEnrlRequest.EMPLID = &emplid;
   &oEnrlRequest.ACAD_CAREER = &acad_career;
   &oEnrlRequest.INSTITUTION = &institution;
   &oEnrlRequest.STRM = &strm;
   Local ApiObject &findResults = &oEnrlRequest.Find();
   Local string &statusCode = "";

   Local number &I;
   For &I = 1 To &findResults.Count
      Local ApiObject &currentEnrlRequest = &findResults.Item(&I);
      If Not &currentEnrlRequest.Get() Then
         Error "Could not get the enrollment request record when verifying if requests exists";
      End-If;
      Local ApiObject &currentEnrlReqDetailCollection = &currentEnrlRequest.ENRL_REQ_DETAIL;
      Local number &J;
      For &J = 1 To &currentEnrlReqDetailCollection.Count
         Local ApiObject &currentEnrlReqDetail = &currentEnrlReqDetailCollection.Item(&J);
         If &currentEnrlReqDetail.CLASS_NBR = &class_nbr Then
            &statusCode = &currentEnrlReqDetail.ENRL_REQ_DETL_STAT;
         End-If;
      End-For;
   End-For;

   Return CreateArray(CreateArrayAny(&statusCode));
end-method;

/**
* This function provides an interface to the College Adaptor to 
* get the logs produced by the built-in enrollment engine when
* it tries to process an enrollment add/drop/grade request
*
* @param &bindVars array of data keys to retrieve logs of
* &bindVars[1]: sisPersonId (aka emplid)
* &bindVars[2]: sisTermId (aka strm)
* &bindVars[3]: sisSectionId (aka class nbr)
* &bindVars[4]: institution
* &bindVars[5]: academic career
* &bindVars[6]: request Id
* @Returns 2d array containing the error messages of the enrollment request process
*/
method getEnrollmentErrorMessage
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_ENRL_MSG_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error String(&sql.Status);
   Else
      If &sql.Status = %SQLStatus_OK Then
         Local number &i = 0;
         Local number &maxRows = 100;
         While &sql.Fetch(&AAny) And
               &i < &maxRows
            Local number &j = 0;
            Local array of any &temp = CreateArrayAny();
            For &j = 1 To &AAny.Len
               &temp.Push(&AAny [&j]);
            End-For;
            &result_list.Push(&temp);
            &i = &i + 1;
         End-While;
      End-If;
   End-If;
   &sql.Close();

   Return &result_list;

end-method;

/**
* This function provides an interface to the College Adaptor to 
* retrieve all the prerequisite status for the given student in
* the given class assuming the class starts on/after the given date
* 
* @param &bindVars array of keys to retrieve from the staging table
* &bindVars[1]: sis Person Id (aka EMPLID)
* &bindVars[2]: start Date
* &bindVars[3]: sis Course Id (aka SUBJ-NBR)
* &bindVars[4]: institution code
* &bindVars[5]: academic career code
* @Returns 2d array with the prerequisite status in first row
*/
method getStudentPrerequisiteStatus
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   rem validate parameters/arguments;
   If &bindVars.Len <> 5 Then
      Error "bindVars should have 5 elements when requesting enrollment";
   End-If;

   If None(&bindVars [1]) Then
      Error "sisPersonId is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "Start Date is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "Course id is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "institution is required";
   End-If;

   If None(&bindVars [5]) Then
      Error "acad_career is required";
   End-If;

   Local array of any &AAny = CreateArrayAny();
   Local array of array &result_list = CreateArrayRept(&AAny, 0);

   Local SQL &sql = GetSQL(SQL.CCTC_ENRL_PREREQ_GET, &bindVars);
   If &sql.Status <> %SQLStatus_OK And
         &sql.Status <> %SQLStatus_NotFound Then
      Error String(&sql.Status);
   Else
      Local array of any &temp = CreateArrayAny();
      Local string &status = "Complete";
      Local string &descr = "No Prereq";
      If &sql.Status = %SQLStatus_OK Then
         Local number &i = 0;
         Local number &maxRows = 1;
         While &sql.Fetch(&AAny) And
               &i < &maxRows
            &status = &AAny [1];
            &descr = &AAny [2];

            Evaluate &status
            When "COND"
               &status = "Pending";
               Break;
            When "FAIL"
               &status = "Incomplete";
               Break;
            When-Other
               &status = "Other";
            End-Evaluate;
            &i = &i + 1;
         End-While;
      End-If;
      &temp.Push(&status);
      &temp.Push(&descr);
      &result_list.Push(&temp);
   End-If;
   &sql.Close();

   Return &result_list;

end-method;
